{
    "openapi": "3.0.0",
    "info": {
        "title": "VTEX Tracking APIs",
        "description": "REST API of VTEX Tracking services. This API is only available in our Brazilian operation, for VTEX Tracking customers. The APIs are used for consulting and registering services in the VTEX Tracking system.",
        "contact": {
            "name": "VTEX Tracking",
            "url": "https://vtex.com/br-pt/tracking/",
            "email": "suportetracking@vtex.com.br"
        },
        "version": "1.1"
    },
    "servers": [
        {
            "url": "https://api.vtextracking.com/receiver",
            "variables": {
                "api.vtextracking.com": {
                    "default": "api.vtextracking.com"
                }
            }
        }
    ],
    "paths": {
        "/auth": {
            "post": {
                "tags": [
                    "Authentication"
                ],
                "summary": "Asynchronous Login",
                "description": "This endpoint permits the user to acquire the mandatory authentication to access the VTEX Tracking endpoints.",
                "parameters": [
                    {
                        "name": "Content-Type",
                        "in": "header",
                        "description": "Type of the content being sent",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "default": "application/json"
                        }
                    },
                    {
                        "name": "Accept",
                        "in": "header",
                        "description": "HTTP Client Negotiation Accept Header. Indicates the types of responses the client can understand",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "default": "application/json"
                        }
                    }
                ],
                "requestBody": {
                    "description": "",
                    "content": {
                        "application/json": {
                            "schema": {
                                "type": "object",
                                "title": "Request body",
                                "default": {},
                                "required": [
                                    "username",
                                    "password"
                                ],
                                "properties": {
                                    "username": {
                                        "type": "string",
                                        "description": "Add client's username",
                                        "default": "username"
                                    },
                                    "password": {
                                        "type": "string",
                                        "description": "Add client's password",
                                        "default": "password"
                                    }
                                }
                            }
                        }
                    }
                },
                "responses": {
                    "200": {
                        "description": "Success",
                        "headers": {},
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/TokenResponse"
                                }
                            }
                        }
                    },
                    "401": {
                        "description": "Unauthorized"
                    }
                },
                "deprecated": false
            }
        },
        "/services": {
            "put": {
                "tags": [
                    "Delivery Services"
                ],
                "summary": "Remove Packing List",
                "description": "Removes Packing List on your VTEX Tracking configuration. Your request body must contain the invoice and serie fields.",
                "security": [
                    {
                        "Authorization": [
                            "Bearer {token}"
                        ]
                    }
                ],
                "parameters": [
                    {
                        "name": "Content-Type",
                        "in": "header",
                        "description": "Type of the content being sent",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "default": "application/json"
                        }
                    },
                    {
                        "name": "Accept",
                        "in": "header",
                        "description": "HTTP Client Negotiation Accept Header. Indicates the types of responses the client can understand",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "default": "application/json"
                        }
                    }
                ],
                "requestBody": {
                    "description": "",
                    "content": {
                        "application/json": {
                            "schema": {
                                "type": "array",
                                "items": {
                                    "$ref": "#/components/schemas/InvoiceFilter"
                                }
                            }
                        }
                    }
                },
                "responses": {
                    "200": {
                        "description": "Success",
                        "headers": {}
                    }
                },
                "deprecated": false
            },
            "post": {
                "tags": [
                    "Delivery Services"
                ],
                "summary": "Post Delivery Service",
                "description": "Creates a delivery service in your Tracking system. It allows the user to configure the Route Scheduling services, without defining the Delivery Person or Route Date.",
                "security": [
                    {
                        "Authorization": []
                    }
                ],
                "parameters": [
                    {
                        "name": "Content-Type",
                        "in": "header",
                        "description": "Type of the content being sent",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "default": "application/json"
                        }
                    },
                    {
                        "name": "Accept",
                        "in": "header",
                        "description": "HTTP Client Negotiation _Accept_ Header. Indicates the types of responses the client can understand",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "default": "application/json"
                        }
                    }
                ],
                "requestBody": {
                    "description": "",
                    "content": {
                        "application/json": {
                            "schema": {
                                "$ref": "#/components/schemas/DeliveryService"
                            }
                        }
                    },
                    "required": true
                },
                "responses": {
                    "200": {
                        "description": "Success",
                        "headers": {}
                    },
                    "400": {
                        "description": "Bad Request"
                    }
                },
                "deprecated": false
            },
            "get": {
                "tags": [
                    "Delivery Services"
                ],
                "summary": "Get Delivery Services List",
                "description": "Retrieves a list of services with pagination and urls. You can consult the list using the following filters: the service's registration date, status, page size, and desired number of pages. Check the parameters documented below to see each filter's description.",
                "security": [
                    {
                        "Authorization": []
                    }
                ],
                "parameters": [
                    {
                        "name": "Content-Type",
                        "in": "header",
                        "description": "Type of the content being sent",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "default": "application/json"
                        }
                    },
                    {
                        "name": "Accept",
                        "in": "header",
                        "description": "HTTP Client Negotiation Accept Header. Indicates the types of responses the client can understand",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "default": "application/json"
                        }
                    },
                    {
                        "name": "status",
                        "in": "query",
                        "description": "Current status of the delivery service. The status parameters are not case sensitive, you can write them with upper or lower case. This field includes the following statuses as possible values: Ativo, Roteirizado, Realizado, EmAndamento, NaoRealizado",
                        "style": "form",
                        "schema": {
                            "type": "string",
                            "default": "Ativo"
                        }
                    },
                    {
                        "name": "dateInit",
                        "in": "query",
                        "description": "Initial date of registration, of the requested service. The format is date-time.",
                        "style": "form",
                        "schema": {
                            "type": "string",
                            "format": "date-time",
                            "default": "2013-10-21T13:28:06.419Z"
                        }
                    },
                    {
                        "name": "dateEnd",
                        "in": "query",
                        "description": "End date of registration, of the requested service. The format is date-time.\n\r\n\rMake sure that the period of time between `dateInit` and `dateEnd` is not greater than 30 days.",
                        "style": "form",
                        "schema": {
                            "type": "string",
                            "format": "date-time",
                            "default": "2013-10-21T13:28:06.419Z"
                        }
                    },
                    {
                        "name": "pageSize",
                        "in": "query",
                        "description": "Number of items shown per consultation page. The default is 25",
                        "style": "form",
                        "schema": {
                            "type": "integer",
                            "format": "int32",
                            "default": 40
                        }
                    },
                    {
                        "name": "page",
                        "in": "query",
                        "description": "The consultation's desired page",
                        "style": "form",
                        "schema": {
                            "type": "integer",
                            "format": "int32",
                            "default": 1
                        }
                    }
                ],
                "responses": {
                    "200": {
                        "description": "Success",
                        "headers": {},
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/PaginationResultDeliveryServiceResponsev11"
                                }
                            }
                        }
                    },
                    "400": {
                        "description": "Bad Request"
                    },
                    "404": {
                        "description": "Not Found"
                    }
                },
                "deprecated": false
            }
        },
        "/services/{idDeliveryService}": {
            "get": {
                "tags": [
                    "Delivery Services"
                ],
                "summary": "Get Delivery Service by ID",
                "description": "Retrieves a specific Service's general information, by searching through its ID",
                "security": [
                    {
                        "Authorization": []
                    }
                ],
                "parameters": [
                    {
                        "name": "Content-Type",
                        "in": "header",
                        "description": "Type of the content being sent",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "default": "application/json"
                        }
                    },
                    {
                        "name": "Accept",
                        "in": "header",
                        "description": "HTTP Client Negotiation _Accept_ Header. Indicates the types of responses the client can understand",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "default": "application/json"
                        }
                    },
                    {
                        "name": "idDeliveryService",
                        "in": "path",
                        "description": "The delivery service's unique identifier",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "integer",
                            "default": 1
                        }
                    }
                ],
                "responses": {
                    "200": {
                        "description": "Success",
                        "headers": {},
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/DeliveryServiceResponse_v1_1"
                                }
                            }
                        }
                    }
                }
            }
        },
        "/services/routes": {
            "post": {
                "tags": [
                    "Delivery Services"
                ],
                "summary": "Post Delivery Service With Route Scheduling",
                "operationId": "PostDeliveryServiceWithRouteAsync",
                "description": "Creates a delivery service in your Tracking system. It allows the user to configure the Route Scheduling services, with the Delivery Person and Route date already defined.",
                "security": [
                    {
                        "Authorization": []
                    }
                ],
                "parameters": [
                    {
                        "name": "Content-Type",
                        "in": "header",
                        "description": "Type of the content being sent",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "default": "application/json"
                        }
                    },
                    {
                        "name": "Accept",
                        "in": "header",
                        "description": "HTTP Client Negotiation Accept Header. Indicates the types of responses the client can understand",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "default": "application/json"
                        }
                    }
                ],
                "requestBody": {
                    "description": "",
                    "content": {
                        "application/json": {
                            "schema": {
                                "$ref": "#/components/schemas/PostWithRoute"
                            }
                        }
                    },
                    "required": true
                },
                "responses": {
                    "200": {
                        "description": "Success",
                        "headers": {}
                    }
                },
                "deprecated": false
            },
            "get": {
                "tags": [
                    "Delivery Services"
                ],
                "summary": "Get Delivery Services List by Route",
                "description": "Retrieves a list of Delivery Services by Route Item Date Async",
                "security": [
                    {
                        "Authorization": []
                    }
                ],
                "parameters": [
                    {
                        "name": "Content-Type",
                        "in": "header",
                        "description": "Type of the content being sent",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "default": "application/json"
                        }
                    },
                    {
                        "name": "Accept",
                        "in": "header",
                        "description": "HTTP Client Negotiation Accept Header. Indicates the types of responses the client can understand",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "default": "application/json"
                        }
                    },
                    {
                        "name": "status",
                        "in": "query",
                        "description": "Current status of the delivery service. Includes the following statuses as possible values: Ativo, Roteirizado, Realizado, EmAndamento, NaoRealizado",
                        "style": "form",
                        "schema": {
                            "type": "string",
                            "default": "Ativo"
                        }
                    },
                    {
                        "name": "dateInit",
                        "in": "query",
                        "description": "Initial date of registration, of the requested service. The format is date-time.",
                        "style": "form",
                        "schema": {
                            "type": "string",
                            "format": "date-time",
                            "default": "2013-10-21T13:28:06.419Z"
                        }
                    },
                    {
                        "name": "dateEnd",
                        "in": "query",
                        "description": "End date of registration, of the requested service. The format is date-time.\n\r\n\rMake sure that the period of time between `dateInit` and `dateEnd` is not greater than 30 days.",
                        "style": "form",
                        "schema": {
                            "type": "string",
                            "format": "date-time",
                            "default": "2013-10-21T13:28:06.419Z"
                        }
                    },
                    {
                        "name": "pageSize",
                        "in": "query",
                        "description": "Number of items shown per consultation page. The default is 25",
                        "style": "form",
                        "schema": {
                            "type": "integer",
                            "format": "int32",
                            "default": 40
                        }
                    },
                    {
                        "name": "page",
                        "in": "query",
                        "description": "The desired page for the consultation",
                        "style": "form",
                        "schema": {
                            "type": "integer",
                            "format": "int32",
                            "default": 1
                        }
                    }
                ],
                "responses": {
                    "200": {
                        "description": "Success",
                        "headers": {},
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/PaginationResultDeliveryServiceResponsev11"
                                }
                            }
                        }
                    },
                    "400": {
                        "description": "Bad Request"
                    },
                    "404": {
                        "description": "Not Found"
                    }
                }
            }
        },
        "/services/invoice": {
            "get": {
                "tags": [
                    "Delivery Services"
                ],
                "summary": "Get Delivery Service by Invoice",
                "description": "Retrieves a given Service's information by filtering through the chosen invoice number",
                "security": [
                    {
                        "Authorization": []
                    }
                ],
                "parameters": [
                    {
                        "name": "Content-Type",
                        "in": "header",
                        "description": "Type of the content being sent",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "default": "application/json"
                        }
                    },
                    {
                        "name": "Accept",
                        "in": "header",
                        "description": "HTTP Client Negotiation Accept Header. Indicates the types of responses the client can understand",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "default": "application/json"
                        }
                    },
                    {
                        "name": "invoice",
                        "in": "query",
                        "description": "Invoice code",
                        "style": "form",
                        "schema": {
                            "type": "string",
                            "default": ""
                        }
                    }
                ],
                "responses": {
                    "200": {
                        "description": "Success",
                        "headers": {},
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/PaginationResultDeliveryServiceResponsev11"
                                }
                            }
                        }
                    },
                    "400": {
                        "description": "Bad Request"
                    },
                    "404": {
                        "description": "Not Found"
                    }
                },
                "deprecated": false
            }
        }
    },
    "components": {
        "securitySchemes": {
            "Authorization": {
                "type": "http",
                "scheme": "bearer",
                "description": "To use the endpoints, please login through the Authentication API, and copy the access token in the response."
            }
        },
        "schemas": {
            "TokenResponse": {
                "title": "TokenResponse",
                "type": "object",
                "properties": {
                    "authenticated": {
                        "type": "boolean"
                    },
                    "created": {
                        "type": "string"
                    },
                    "expiration": {
                        "type": "string"
                    },
                    "accessToken": {
                        "type": "string"
                    },
                    "message": {
                        "type": "string"
                    }
                }
            },
            "PaginationResultDeliveryServiceResponsev11": {
                "title": "Pagination Result[Delivery Service Response _v1_1]",
                "type": "object",
                "properties": {
                    "page": {
                        "type": "integer",
                        "format": "int32"
                    },
                    "pageSize": {
                        "type": "integer",
                        "format": "int32"
                    },
                    "totalCount": {
                        "type": "integer",
                        "format": "int32"
                    },
                    "data": {
                        "type": "array",
                        "items": {
                            "$ref": "#/components/schemas/DeliveryServiceResponse_v1_1"
                        },
                        "description": ""
                    }
                }
            },
            "PostWithRoute": {
                "title": "PostWithRoute",
                "required": [
                    "deliveryServiceDate"
                ],
                "type": "object",
                "properties": {
                    "deliveryService": {
                        "type": "array",
                        "items": {
                            "$ref": "#/components/schemas/DeliveryService"
                        },
                        "description": ""
                    },
                    "deliveryServiceRoute": {
                        "$ref": "#/components/schemas/DeliveryServiceRoute"
                    }
                }
            },
            "DeliveryServiceRoute": {
                "title": "DeliveryServiceRoute",
                "required": [
                    "carrier",
                    "displacementType",
                    "deliveryServiceDate"
                ],
                "type": "object",
                "properties": {
                    "carrier": {
                        "$ref": "#/components/schemas/Carrier"
                    },
                    "displacementType": {
                        "maxLength": 15,
                        "minLength": 0,
                        "type": "string"
                    },
                    "vehicle": {
                        "$ref": "#/components/schemas/Vehicle"
                    },
                    "deliveryServiceRouteTimeOfDay": {
                        "maxLength": 10,
                        "minLength": 0,
                        "type": "string"
                    },
                    "deliveryServiceDate": {
                        "type": "string",
                        "format": "date-time"
                    },
                    "idExternalRoute": {
                        "maxLength": 50,
                        "minLength": 0,
                        "type": "string"
                    },
                    "itinerantDate": {
                        "type": "string",
                        "format": "date-time"
                    },
                    "addressStart": {
                        "$ref": "#/components/schemas/AddressStart"
                    }
                }
            },
            "Carrier": {
                "title": "Carrier",
                "required": [
                    "username"
                ],
                "type": "object",
                "properties": {
                    "username": {
                        "maxLength": 100,
                        "minLength": 0,
                        "type": "string"
                    },
                    "firstName": {
                        "maxLength": 100,
                        "minLength": 0,
                        "type": "string"
                    },
                    "lastName": {
                        "maxLength": 100,
                        "minLength": 0,
                        "type": "string"
                    },
                    "cpf": {
                        "maxLength": 14,
                        "minLength": 0,
                        "type": "string"
                    },
                    "email": {
                        "maxLength": 254,
                        "minLength": 0,
                        "type": "string"
                    },
                    "mobileAreaCode": {
                        "maxLength": 3,
                        "minLength": 0,
                        "type": "string"
                    },
                    "mobile": {
                        "maxLength": 10,
                        "minLength": 0,
                        "type": "string"
                    },
                    "phoneAreaCode": {
                        "maxLength": 3,
                        "minLength": 0,
                        "type": "string"
                    },
                    "phone": {
                        "maxLength": 10,
                        "minLength": 0,
                        "type": "string"
                    },
                    "idExternalCarrier": {
                        "maxLength": 30,
                        "minLength": 0,
                        "type": "string"
                    },
                    "rg": {
                        "maxLength": 12,
                        "minLength": 0,
                        "type": "string"
                    },
                    "idShipperBranch": {
                        "type": "integer",
                        "format": "int32"
                    },
                    "idShippingCompany": {
                        "type": "integer",
                        "format": "int32"
                    }
                }
            },
            "Vehicle": {
                "title": "Vehicle",
                "type": "object",
                "properties": {
                    "registrationPlate": {
                        "maxLength": 50,
                        "minLength": 0,
                        "type": "string"
                    }
                }
            },
            "AddressStart": {
                "title": "AddressStart",
                "type": "object",
                "properties": {
                    "addressStreet": {
                        "type": "string"
                    },
                    "addressNumber": {
                        "type": "string"
                    },
                    "postalCode": {
                        "type": "string"
                    },
                    "addressCity": {
                        "type": "string"
                    },
                    "state": {
                        "maxLength": 2,
                        "minLength": 0,
                        "type": "string"
                    }
                }
            },
            "DeliveryService": {
                "title": "DeliveryService",
                "type": "array",
                "items": {
                    "$ref": "#/components/schemas/DeliveryServiceObject"
                }
            },
            "DeliveryServiceObject": {
                "title": "Delivery Service Object",
                "required": [
                    "deliveryServiceType",
                    "shipperCustomer"
                ],
                "type": "object",
                "properties": {
                    "deliveryServiceType": {
                        "maxLength": 11,
                        "minLength": 0,
                        "type": "string"
                    },
                    "idExternalShipperCustomer": {
                        "maxLength": 30,
                        "minLength": 0,
                        "type": "string"
                    },
                    "shipperCustomer": {
                        "$ref": "#/components/schemas/ShipperCustomer"
                    },
                    "invoiceOrderOfService": {
                        "type": "string"
                    },
                    "invoiceOrderOfServiceSerie": {
                        "maxLength": 3,
                        "minLength": 0,
                        "type": "string"
                    },
                    "description": {
                        "type": "string"
                    },
                    "sender": {
                        "type": "string"
                    },
                    "cnpjShipperPartner": {
                        "type": "string"
                    },
                    "orderNumber": {
                        "maxLength": 200,
                        "minLength": 0,
                        "type": "string"
                    },
                    "deliveryServiceHighLighter": {
                        "maxLength": 11,
                        "minLength": 0,
                        "type": "string"
                    },
                    "latitude": {
                        "type": "number"
                    },
                    "longitude": {
                        "type": "number"
                    },
                    "deliveryServiceScheduling": {
                        "$ref": "#/components/schemas/Scheduling"
                    },
                    "cnpjcarrier": {
                        "type": "string"
                    },
                    "cnpjbranch": {
                        "type": "string"
                    },
                    "idExternal": {
                        "maxLength": 30,
                        "minLength": 0,
                        "type": "string"
                    },
                    "idShippingCompany": {
                        "type": "integer",
                        "format": "int32"
                    },
                    "packingList": {
                        "maxLength": 50,
                        "minLength": 0,
                        "type": "string"
                    },
                    "packingListDateTime": {
                        "type": "string",
                        "format": "date-time"
                    },
                    "integrationDateTime": {
                        "type": "string",
                        "format": "date-time"
                    }
                }
            },
            "ShipperCustomer": {
                "title": "ShipperCustomer",
                "required": [
                    "legalType",
                    "addressStreet",
                    "postalCode"
                ],
                "type": "object",
                "properties": {
                    "legalType": {
                        "maxLength": 2,
                        "minLength": 2,
                        "type": "string"
                    },
                    "email": {
                        "maxLength": 254,
                        "minLength": 0,
                        "type": "string"
                    },
                    "firstName": {
                        "maxLength": 100,
                        "minLength": 0,
                        "type": "string"
                    },
                    "lastName": {
                        "maxLength": 100,
                        "minLength": 0,
                        "type": "string"
                    },
